import Tiza from './FotosDeGeneros/Tiza.png';
import Ceniza from './FotosDeGeneros/Ceniza.png';
import Carbón from './FotosDeGeneros/Carbon.png';
import Negro from './FotosDeGeneros/Negro.png';
import Natural from './FotosDeGeneros/Natural.png';
import Nougat from './FotosDeGeneros/Nougat.png';
import Madera from './FotosDeGeneros/Madera.png';
import Lila from './FotosDeGeneros/Lila.png';
import Pink from './FotosDeGeneros/Pink.png';
import Limon from './FotosDeGeneros/Limon.png';
import Turquesa from './FotosDeGeneros/Turquesa.png';
import AzulLavado from './FotosDeGeneros/AzulLavado.png';
import Marino from './FotosDeGeneros/Marino.png';
import Guinda from './FotosDeGeneros/Guinda.png';
import Cafe from './FotosDeGeneros/Cafe.png';

export const colores = (nombre) =>{
  
  let color={
    //Generos de Lino Paris
      'Tiza': Tiza,
      // 'Stone': Stone,
      'Ceniza': Ceniza,
      // 'Grafito': Grafito,
      'Carbón': Carbón,
      'Negro': Negro,
      'Natural': Natural,
      // 'Niebla': Niebla,
      'Nougat': Nougat,
      'Madera': Madera,
      'Lila': Lila,
      'Pink': Pink,
      'Limón': Limon,
      // 'Agua': Agua,
      'Turquesa': Turquesa,
      // 'Blue': Blue,
      'Azul Lavado': AzulLavado,
      // 'Denim': Denim,
      'Marino': Marino,
      // 'Pimenton': Pimenton,
      // 'Lacre': Lacre,
      'Guinda': Guinda, 
      // 'Ginger': Ginger, 
      'Café': Cafe, 
      // 'Arena': Arena
      "default": "#000"
  }
  return (color[nombre] || color['default']);
}



export const ColorDeFondo = (nombre) => {
    let color={
      //Generos de Lino Paris
        'Tiza': "#f3f4e7",
        // 'Stone': Stone,
        'Ceniza': "#ceced0",
        // 'Grafito': Grafito,
        'Carbón': "#b5b3bc",
        'Negro': "#111",
        'Natural': "beige",
        // 'Niebla': Niebla,
        'Nougat': "#fdfae9",
        'Madera': "#b19d77",
        'Lila': "#c96e64",
        'Pink': "#ffcbb3",
        'Limón': "#f3d87c",
        // 'Agua': Agua,
        'Turquesa': "#7fe1b2",
        // 'Blue': Blue,
        'Azul Lavado': "#b3cfd6",
        // 'Denim': Denim,
        'Marino': "#030b35",
        // 'Pimenton': Pimenton,
        // 'Lacre': Lacre,
        'Guinda': "#d43535", 
        // 'Ginger': Ginger, 
        'Café': "#a66321", 
        // 'Arena': Arena
    }
    
  
  
  return color[nombre];

};
